import React, {Component} from 'react';
import './App.css';
import logo from './logo.svg';
export default class App extends Component {

    render() {
        return (
            <div>
                <header className="App-header">
                    <img src={logo} className="App-logo" alt="logo" />
                </header>
                <div className="App" />
            </div>
        );
    }
}
